import React from "react";
import Schedule from "./components/Schedule";
import { TeachersProvider } from "../context/TeachersContext";
import "./App.css";

const teacher = { name: "Miles", teachingMins: 75 };

function App() {
  return (
    <div className="App">
      <TeachersProvider value={teacher}>
        <Schedule />
      </TeachersProvider>
    </div>
  );
}

export default App;
